import './searchitem.css'

export default function SearchItem(props) {
    function changeText(){
        if(props.language==="PORT"){
            return props.option==="Search"?"Search":"Cataloging";
        }else{
            return props.option==="Busca"?"Catalogação":"Busca";
        }    
    }
    let url = "";

    return (
        <div onClick={() => props.clickHandler()}>
            <a href={url}>{changeText()}</a>
        </div>
    );
}
